import React from 'react'

export default function Settings() {
    
    async function loginUser() {
    
		const response = await fetch('http://localhost:1337/api/login', {
			method: 'GET',
			headers: {
				'Content-Type': 'application/json',
			},
		})

		const data = await response.json()
	}  


    return (
    <div>Settings</div>
  )
}
